import React from "react";
import { Box, Typography, Stack, Paper } from "@mui/material";

type ProjectProps = {
  name: string;
  description: string;
  techStack: string[];
};

function Projects(props: ProjectProps) {
  return (
    <Box>
      <Typography className="project-name">{props.name}</Typography>
      <Typography className="project-description">
        {props.description}
      </Typography>
      <Stack direction="row" spacing={2}>
        {props.techStack.map((x) => (
          <Typography className="project-tech-stack">{x}</Typography>
        ))}
      </Stack>
    </Box>
  );
}

export default Projects;
